<!-- qualification slider script start -->
<script>
	
  var qualSlider = document.getElementById('qualSlider'),
      qualSliderItems = document.getElementById('qualItems'),
      qualPrev = document.getElementById('qualPrev'),
      qualNext = document.getElementById('qualNext');
  
  slide(qualSlider, qualSliderItems, qualPrev, qualNext);
  
  function slide(qualWrapper, qualItems, qualPrev, qualNext) {
    var posX1 = 0,
        posX2 = 0,
        posInitial,
        posFinal,
        threshold = 100,
        slides = qualItems.getElementsByClassName('qualSlide'),
        slidesLength = slides.length,
        slideSize = qualItems.getElementsByClassName('qualSlide')[0].offsetWidth,
        firstSlide = slides[0],
        lastSlide = slides[slidesLength - 1],
        cloneFirst = firstSlide.cloneNode(true),
        cloneLast = lastSlide.cloneNode(true),
        index = 0,
        allowShift = true;
    
    // Clone first and last slide
    qualItems.appendChild(cloneFirst);
    qualItems.insertBefore(cloneLast, firstSlide);
    qualWrapper.classList.add('loaded');
    
    // Mouse and Touch events
    qualItems.onmousedown = dragBook;
    
    // Touch events
    qualItems.addEventListener('touchstart', dragBook);
    qualItems.addEventListener('touchend', dragEnd);
    qualItems.addEventListener('touchmove', dragAction);
    
    // Click events
    qualPrev.addEventListener('click', function () { shiftSlide(-1) });
    qualNext.addEventListener('click', function () { shiftSlide(1) });
    
    // Transition events
    qualItems.addEventListener('transitionend', checkIndex);
    
    function dragBook (e) {
      e = e || window.event;
      e.preventDefault();
      posInitial = qualItems.offsetLeft;
      
      if (e.type == 'touchstart') {
        posX1 = e.touches[0].clientX;
      } else {
        posX1 = e.clientX;
        document.onmouseup = dragEnd;
        document.onmousemove = dragAction;
      }
    }
  
    function dragAction (e) {
      e = e || window.event;
      
      if (e.type == 'touchmove') {
        posX2 = posX1 - e.touches[0].clientX;
        posX1 = e.touches[0].clientX;
      } else {
        posX2 = posX1 - e.clientX;
        posX1 = e.clientX;
      }
      qualItems.style.left = (qualItems.offsetLeft - posX2) + "px";
    }
    
    function dragEnd (e) {
      posFinal = qualItems.offsetLeft;
      if (posFinal - posInitial < -threshold) {
        shiftSlide(1, 'drag');
      } else if (posFinal - posInitial > threshold) {
        shiftSlide(-1, 'drag');
      } else {
        qualItems.style.left = (posInitial) + "px";
      }
  
      document.onmouseup = null;
      document.onmousemove = null;
    }
    
    function shiftSlide(dir, action) {
      qualItems.classList.add('shifting');
      
      if (allowShift) {
        if (!action) { posInitial = qualItems.offsetLeft; }
  
        if (dir == 1) {
          qualItems.style.left = (posInitial - slideSize) + "px";
          index++;      
        } else if (dir == -1) {
          qualItems.style.left = (posInitial + slideSize) + "px";
          index--;      
        }
      };
      
      allowShift = false;
    }
      
    function checkIndex (){
      qualItems.classList.remove('shifting');
  
      if (index == -1) {
        qualItems.style.left = -(slidesLength * slideSize) + "px";
        index = slidesLength - 1;
      }
  
      if (index == slidesLength) {
        qualItems.style.left = -(1 * slideSize) + "px";
        index = 0;
      }
      
      allowShift = true;
    }
  }
    
</script>
<!-- qualification slider script end -->

<script>//tbh banner
  var TBHslider = document.getElementById('TBHslider'),
      TBHsliderItems = document.getElementById('TBHitems'),
      TBHprev = document.getElementById('TBHprev'),
      TBHnext = document.getElementById('TBHnext');

  slide(TBHslider, TBHsliderItems, TBHprev, TBHnext);

  function slide(TBHwrapper, TBHitems, TBHprev, TBHnext) {
    var posX1 = 0,
        posX2 = 0,
        posInitial,
        posFinal,
        threshold = 100,
        slides = TBHitems.getElementsByClassName('TBHslide'),
        slidesLength = slides.length,
        slideSize = TBHitems.getElementsByClassName('TBHslide')[0].offsetWidth,
        firstSlide = slides[0],
        lastSlide = slides[slidesLength - 1],
        cloneFirst = firstSlide.cloneNode(true),
        cloneLast = lastSlide.cloneNode(true),
        index = 0,
        allowShift = true;
    
    // Clone first and last slide
    TBHitems.appendChild(cloneFirst);
    TBHitems.insertBefore(cloneLast, firstSlide);
    TBHwrapper.classList.add('loaded');
    
    // Mouse and Touch events
    TBHitems.onmousedown = dragStart;
    
    // Touch events
    TBHitems.addEventListener('touchstart', dragStart);
    TBHitems.addEventListener('touchend', dragEnd);
    TBHitems.addEventListener('touchmove', dragAction);
    
    // Click events
    TBHprev.addEventListener('click', function () { shiftSlide(-1) });
    TBHnext.addEventListener('click', function () { shiftSlide(1) });
    
    // Transition events
    TBHitems.addEventListener('transitionend', checkIndex);
    
    function dragStart (e) {
      e = e || window.event;
      e.preventDefault();
      posInitial = TBHitems.offsetLeft;
      
      if (e.type == 'touchstart') {
        posX1 = e.touches[0].clientX;
      } else {
        posX1 = e.clientX;
        document.onmouseup = dragEnd;
        document.onmousemove = dragAction;
      }
    }

    function dragAction (e) {
      e = e || window.event;
      
      if (e.type == 'touchmove') {
        posX2 = posX1 - e.touches[0].clientX;
        posX1 = e.touches[0].clientX;
      } else {
        posX2 = posX1 - e.clientX;
        posX1 = e.clientX;
      }
      TBHitems.style.left = (TBHitems.offsetLeft - posX2) + "px";
    }
    
    function dragEnd (e) {
      posFinal = TBHitems.offsetLeft;
      if (posFinal - posInitial < -threshold) {
        shiftSlide(1, 'drag');
      } else if (posFinal - posInitial > threshold) {
        shiftSlide(-1, 'drag');
      } else {
        TBHitems.style.left = (posInitial) + "px";
      }

      document.onmouseup = null;
      document.onmousemove = null;
    }
    
    function shiftSlide(dir, action) {
      TBHitems.classList.add('shifting');
      
      if (allowShift) {
        if (!action) { posInitial = TBHitems.offsetLeft; }

        if (dir == 1) {
          TBHitems.style.left = (posInitial - slideSize) + "px";
          index++;      
        } else if (dir == -1) {
          TBHitems.style.left = (posInitial + slideSize) + "px";
          index--;      
        }
      };
      
      allowShift = false;
    }
      
    function checkIndex (){
      TBHitems.classList.remove('shifting');

      if (index == -1) {
        TBHitems.style.left = -(slidesLength * slideSize) + "px";
        index = slidesLength - 1;
      }

      if (index == slidesLength) {
        TBHitems.style.left = -(1 * slideSize) + "px";
        index = 0;
      }
      
      allowShift = true;
    }
}
</script>

<script>
  document.querySelector('body').addEventListener('mousemove', eyeball);
  function eyeball(){
    var eye = document.querySelectorAll('.eye');
    eye.forEach(function(eye){
      let x = eye.getBoundingClientRect().left + (eye.clientWidth/2);
      let y = eye.getBoundingClientRect().top + (eye.clientWidth/2);
      let radian = Math.atan2(event.pageX - x, event.pageY - y);
      let rotation = (radian * (180 / Math.PI) * -1) + 270;
      eye.style.transform = "rotate("+ rotation +"deg)";
    })
  }
</script>

    this.upsideDown = false;
  
    this.previousPositionX = 0;
    this.previousPositionY = 0;
  
    this.currentSide = 0;
    this.calculatedSide = 0;
  
  
    bindEvent(document, 'mousedown', function() {
      self.down = true;
    });
  
    bindEvent(document, 'mouseup', function() {
      self.down = false;
    });
    
    bindEvent(document, 'keyup', function() {
      self.down = false;
    });
  
    bindEvent(document, 'mousemove', function(e) {
      self.mouseX = e.pageX;
      self.mouseY = e.pageY;
    });
  
    bindEvent(document, 'touchstart', function(e) {
  
      self.down = true;
      e.touches ? e = e.touches[0] : null;
      self.mouseX = e.pageX / self.touchSensivity;
      self.mouseY = e.pageY / self.touchSensivity;
      self.lastX  = self.mouseX;
      self.lastY  = self.mouseY;
    });
  
    bindEvent(document, 'touchmove', function(e) {
      if(e.preventDefault) { 
        e.preventDefault();
      }
  
      if(e.touches.length == 1) {
  
        e.touches ? e = e.touches[0] : null;
  
        self.mouseX = e.pageX / self.touchSensivity;
        self.mouseY = e.pageY / self.touchSensivity;
  
      }
    });
  
    bindEvent(document, 'touchend', function(e) {
      self.down = false;
    });  
  
    setInterval(this.animate.bind(this), this.fps);
  
  }
  events.implement(Viewport);
  Viewport.prototype.animate = function() {
  
    this.distanceX = (this.mouseX - this.lastX);
    this.distanceY = (this.mouseY - this.lastY);
  
    this.lastX = this.mouseX;
    this.lastY = this.mouseY;
  
    if(this.down) {
      this.torqueX = this.torqueX * this.sensivityFade + (this.distanceX * this.speed - this.torqueX) * this.sensivity;
      this.torqueY = this.torqueY * this.sensivityFade + (this.distanceY * this.speed - this.torqueY) * this.sensivity;
    }
  
    if(Math.abs(this.torqueX) > 1.0 || Math.abs(this.torqueY) > 1.0) {
      if(!this.down) {
        this.torqueX *= this.sensivityFade;
        this.torqueY *= this.sensivityFade;
      }
  
      this.positionY -= this.torqueY;
  
      if(this.positionY > 360) {
        this.positionY -= 360;
      } else if(this.positionY < 0) {
        this.positionY += 360;
      }
  
      if(this.positionY > 90 && this.positionY < 270) {
        this.positionX -= this.torqueX;
  
        if(!this.upsideDown) {
          this.upsideDown = true;
          this.emit('upsideDown', { upsideDown: this.upsideDown });
        }
  
      } else {
  
        this.positionX += this.torqueX;
  
        if(this.upsideDown) {
          this.upsideDown = false;
          this.emit('upsideDown', { upsideDown: this.upsideDown });
        }
      }
  
      if(this.positionX > 360) {
        this.positionX -= 360;
      } else if(this.positionX < 0) {
        this.positionX += 360;
      }
  
      if(!(this.positionY >= 46 && this.positionY <= 130) && !(this.positionY >= 220 && this.positionY <= 308)) {
        if(this.upsideDown) {
          if(this.positionX >= 42 && this.positionX <= 130) {
            this.calculatedSide = 3;
          } else if(this.positionX >= 131 && this.positionX <= 223) {
            this.calculatedSide = 2;
          } else if(this.positionX >= 224 && this.positionX <= 314) {
            this.calculatedSide = 5;
          } else {
            this.calculatedSide = 4;
          }
        } else {
          if(this.positionX >= 42 && this.positionX <= 130) {
            this.calculatedSide = 5;
          } else if(this.positionX >= 131 && this.positionX <= 223) {
            this.calculatedSide = 4;
          } else if(this.positionX >= 224 && this.positionX <= 314) {
            this.calculatedSide = 3;
          } else {
            this.calculatedSide = 2;
          }
        }
      } else {
        if(this.positionY >= 46 && this.positionY <= 130) {
          this.calculatedSide = 6;
        }
  
        if(this.positionY >= 220 && this.positionY <= 308) {
          this.calculatedSide = 1;
        }
      }
  
      if(this.calculatedSide !== this.currentSide) {
        this.currentSide = this.calculatedSide;
        this.emit('sideChange');
      }
  
    }
  
    this.element.style[userPrefix.js + 'Transform'] = 'rotateX(' + this.positionY + 'deg) rotateY(' + this.positionX + 'deg)';
  
    if(this.positionY != this.previousPositionY || this.positionX != this.previousPositionX) {
      this.previousPositionY = this.positionY;
      this.previousPositionX = this.positionX;
  
      this.emit('rotate');
  
    }
  
  }
  var viewport = new Viewport({
    element: document.getElementsByClassName('cube')[0],
    fps: 20,
    sensivity: .1,
    sensivityFade: .93,
    speed: 2,
    touchSensivity: 1.5
  });
  
  function Cube(data) {
    var self = this;
  
    this.element = data.element;
    this.sides = this.element.getElementsByClassName('side');
  
    this.viewport = data.viewport;
    this.viewport.on('rotate', function() {
      self.rotateSides();
    });
    this.viewport.on('upsideDown', function(obj) {
      self.upsideDown(obj);
    });
    this.viewport.on('sideChange', function() {
      self.sideChange();
    });
  }
  Cube.prototype.rotateSides = function() {
    var viewport = this.viewport;
    if(viewport.positionY > 90 && viewport.positionY < 270) {
      this.sides[0].getElementsByClassName('cubeLogoFace')[0].style[userPrefix.js + 'Transform'] = 'rotate(' + (viewport.positionX + viewport.torqueX) + 'deg)';
      this.sides[5].getElementsByClassName('cubeLogoFace')[0].style[userPrefix.js + 'Transform'] = 'rotate(' + -(viewport.positionX + 180 + viewport.torqueX) + 'deg)';
    } else {
      this.sides[0].getElementsByClassName('cubeLogoFace')[0].style[userPrefix.js + 'Transform'] = 'rotate(' + (viewport.positionX - viewport.torqueX) + 'deg)';
      this.sides[5].getElementsByClassName('cubeLogoFace')[0].style[userPrefix.js + 'Transform'] = 'rotate(' + -(viewport.positionX + 180 - viewport.torqueX) + 'deg)';
    }
  }
  Cube.prototype.upsideDown = function(obj) {
  
    var deg = (obj.upsideDown == true) ? '180deg' : '0deg';
    var i = 5;
  
    while(i > 0 && --i) {
      this.sides[i].getElementsByClassName('cubeLogoFace')[0].style[userPrefix.js + 'Transform'] = 'rotate(' + deg + ')';
    }
  
  }
  Cube.prototype.sideChange = function() {
  
    for(var i = 0; i < this.sides.length; ++i) {
      this.sides[i].getElementsByClassName('cubeLogoFace')[0].className = 'cubeLogoFace';    
    }
  
    this.sides[this.viewport.currentSide - 1].getElementsByClassName('cubeLogoFace')[0].className = 'cubeLogoFace active';
  
  }
  
  new Cube({
    viewport: viewport,
    element: document.getElementsByClassName('cube')[0]
  });
</script>
